import React, { useEffect, useCallback } from 'react'
import axios from 'axios'
import { graphql } from 'graphql'
import { gql } from 'graphql-tag'

const listTransactions = gql`
    query listTransactions {
        listTransactions {
            items {
                id
                totalPrice
                currency
                products {
                    id
                    title
                    bonusPercentage
                    priceAmount
                    priceCurrency
                    image
                }
                customer {
                    id
                    firstName
                    lastName
                    phone
                    email
                }
                createdAt
            }
        }
    }
`

const Index = () => {
    console.log('Hi there Zaven jan')
    const fetchTransactions = useCallback(async () => {
        const transactionsData = await axios({
            url: 'https://transactions-avanta.myshopify.com/admin/api/2020-07/graphql.json',
            method: 'post',
            headers: {
                'Content-Type': 'application/json',
                'X-Shopify-Access-Token': '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'
            },
            data: {
                query: graphql.print(listTransactions)
            }
        })

        console.log('Here is transactions data Zvo', transactionsData.data)
    })

    useEffect(() => {
        fetchTransactions()
    }, [fetchTransactions])
    return <div>Hello from embedded app</div>
}

export default Index
